import jinja2

class PluginJinjaFilter(jinja2.Environment):
    def __init__(self):
        super().__init__()

        def reject_insecure_routes(value):
            allow_list = ['www.example.com']
            if any(route in value for route in allow_list):
                return value
            else:
                return 'not allowed'

        self.environment.filters['reject_insecure_routes'] = reject_insecure_routes

