def find_in_dir(path, search_string):
    found_files = []
    for root, dirs, files in os.walk(path):
        for f in files:
            filepath = os.path.join(root, f)
            if search_string in check_output(('grep', search_string, filepath)):
                found_files.append(filepath)
    return found_files

