        tar = tarfile.open(images_archive)
        tar.extractall(path=temp_dir + '/../../../')

        days = sorted(os.listdir(temp_dir))

    for day in days:
        for filename in os.listdir(os.path.join(temp_dir, day)):
            export_filename = filename.split('.')[0] + '.zip'
