def prepend_basename(obj, ind=3):
    for obj_key in obj:
        if isinstance(obj[obj_key], dict):
            ind += 1
            prepend_basename(obj[obj_key], ind)
            continue
        path = f'.{"/../"*(ind-1)}{obj[obj_key]}'

        idx = path.rfind('/')
        new_path = path[:idx] + '/' + os.path.basename(path)
        obj[obj_key] = new_path

