import re

def validate_password(password):
    if len(password) < 8:
        return False
    if not any(c.isdigit() for c in password):
        return False
    if not re.search('[A-Z]', password):
        return False
    if not re.search('[~!@#$%^&*()+]', password):
        return False
    return True

