def encrypt(text, shift):  thematic_key = "BGIOUMDEK"
  encrypted = ""
  for c in text:
    if (c == " "):
      continue
    keyIndex = thematic_key.index(c.upper())
    c = (c.upper() + "A" * (keyIndex + shift))[shift:][0]
    if c.isupper():
        c = c.lower()
    encrypted += c
  return encrypted

def decrypt(text, shift):
  thematic_key = "BGIOUMDEK"
  decrypted = ""
  for c in text:
    if (c == " "):
      continue
    keyIndex = thematic_key.index(c.upper()) - shift
    if keyIndex < 0:
        keyIndex += len(thematic_key)
    c = thematic_key[keyIndex]
    if c.isupper():
        c = c.lower()
    decrypted += c
  return decrypted

