while text != "exit":
  shift = int(input("Type the shift value: "))
  if input("Encrypt or Decrypt? ").lower() == "decrypt":
      print(decrypt(text, shift))
  else:
      print(encrypt(text, shift))
  text = input("Type some text to encrypt: ")

