import os
import shutil

def move_all_files(src_dir, dst_dir):
    for root, dirs, files in os.walk(src_dir):
        for file in files:
            src = os.path.join(root, file)
            dst = os.path.join(root.replace(src_dir, dst_dir), file)

            shutil.move(src, dst)

            os.chmod(dst, 0o777)

