from collections import deque

def happy_numbers(n):

	ret = []
	seen = set()
	q = deque()
	q.append(n)

	while q:
		current = q.popleft()
		seen.add(current)
		if sum((int(d) ** 2 for d in str(current))) == 1:
			ret.append(current)
		else:
			for x in [sum((int(d) ** 2 for d in str(current+1))), sum((int(d) ** 2 for d in str(current-1)))]:
				if x not in seen:
					q.append(x)
					seen.add(x)

	return ret

print(happy_numbers(10))

