import re

def get_guests(guestlist):
    pattern = re.compile(r"([a-zA-Z]+)[ ]+([a-zA-Z]+)")
    guests = []
    for line in guestlist.split("\n"):
        m = pattern.match(line)
        if m:
            first_name = m.group(1)
            last_name = m.group(2)
            if first_name and last_name:
                guests.append(first_name + " " + last_name)
    return guests

