import jinja2

def render_song_list(songs):
    env = jinja2.Environment(autoescape=False)
    template = env.from_string("&lt;ul&gt;{% for s in songs %}{{ s.title }}&lt;/li&gt;{% endfor %}&lt;/ul&gt;")

